SELECT COUNT(cs_order_number) AS number_of_orders, SUM(cs_ext_ship_cost) AS total_shipping_costs, SUM(cs_net_profit) AS total_profits FROM catalog_sales JOIN customer_address ON cs_ship_addr_sk = ca_address_sk JOIN date_dim ON cs_sold_date_sk = d_date_sk WHERE ca_county = 'Williamson County' AND ca_state = 'GA' AND d_date BETWEEN DATE '2002-03-01' AND DATE '2002-04-29' AND cs_order_number NOT IN (SELECT cr_order_number FROM catalog_returns) AND cs_warehouse_sk IS NOT NULL;
